INSERT INTO `dr_field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, '3d printing homes and structures\r\n\r\n10 year limit on trade secrets\r\n\r\nkickstarter for development of open source technology focused core mecahanical equipment\r\n\r\nproject tracker system via app and huttite.org website', '', 'filtered_html'),
('node', 'page', 0, 2, 2, 'und', 0, 'Our aim is to make use of Kickstarter to support our \r\ninitial efforts to warehouse 3d models, provide tools for\r\nproject management and peer review of 3d printing best\r\npractices and shared/ private logs of technology use \r\nfrom within the huttite.org website and ios/android/win \r\nphone/tablet app ecosystem.\r\n\r\n\r\n\r\n', '', 'filtered_html'),
('node', 'article', 0, 3, 3, 'und', 0, 'We are directing our work in four areas toward providing a public test structures at appropriate locations.\r\n\r\n1. Nozzle design and testing\r\n2. Batch recipe design and consistancy\r\n3. Robotic component design and hardware controller programming\r\n3. Continuous batch flow management\r\n4. Environmental, legal, and social parameter research.', '', 'filtered_html'),
('node', 'article', 0, 4, 4, 'und', 0, '<iframe src="https://3dwarehouse.sketchup.com/embed.html?mid=u35debfa1-2224-4009-b667-4f35d2486a90&width=400&height=300" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" width="400" height="300" allowfullscreen></iframe>\r\n\r\n I was looking around google sketchup''s 3d warehouse, and the most exportable format is google earth KML  \r\n\r\nThe above structure would be a pretty nice design esp. where more roof surface area was beneficial-  cooling, biologically active surfaces...\r\n\r\nGreg\r\n\r\n', '', 'full_html'),
('node', 'article', 0, 5, 5, 'und', 0, '<iframe width="560" height="315" src="//www.youtube.com/embed/aQWSRpacNzY" frameborder="0" allowfullscreen></iframe>\r\n\r\nThis machine is known as the WASP, demonstrating 3d printing of locally derived materials to produce a reinforced contoured structure.\r\n\r\n', '', 'full_html'),
('node', 'document', 0, 6, 6, 'und', 0, '<h1>Duo Reges: constructio interrete.</h1>\r\n\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. <code>Quis enim redargueret?</code> <mark>Quod ea non occurrentia fingunt, vincunt Aristonem;</mark> Quo modo igitur evenit, ut hominis natura sola esset, quae hominem relinqueret, quali oblivisceretur corporis, quae summum bonum non in toto homine, sed in parte hominis poneret? Quid enim dicis omne animal, simul atque sit ortum, applicatum esse ad se diligendum esseque in se conservando occupatum? Quae dici eadem de ceteris virtutibus possunt, quarum omnium fundamenta vos in voluptate tamquam in aqua ponitis. Quid enim dicis omne animal, simul atque sit ortum, applicatum esse ad se diligendum esseque in se conservando occupatum? Quae enim mala illi non audent appellare, aspera autem et incommoda et reicienda et aliena naturae esse concedunt, ea nos mala dicimus, sed exigua et paene minima. <a href=''http://loripsum.net/'' target=''_blank''>Compensabatur, inquit, cum summis doloribus laetitia.</a> <a href=''http://loripsum.net/'' target=''_blank''>Eadem fortitudinis ratio reperietur.</a> <a href=''http://loripsum.net/'' target=''_blank''>Laboro autem non sine causa;</a> Ex ea quae sint apta, ea bonesta, ea pulchra, ea laudabilia, illa autem superiora naturale nominantur, quae coniuncta cum honestis vitam beatam perficiunt et absolvunt. Quid enim est tam repugnans quam eundem dicere, quod honestum sit, solum id bonum esse, qui dicat appetitionem rerum ad vivendum accommodatarum natura profectam? Iam autem Callipho aut Diodorus quo modo poterunt tibi istud concedere, qui ad honestatem aliud adiungant, quod ex eodem genere non sit? <a href=''http://loripsum.net/'' target=''_blank''>Itaque contra est, ac dicitis;</a> <i>Summum ením bonum exposuit vacuitatem doloris;</i> Quid tibi, Torquate, quid huic Triario litterae, quid historiae cognitioque rerum, quid poetarum evolutio, quid tanta tot versuum memoria voluptatis affert? Appellet haec desideria naturae, cupiditatis nomen servet alio, ut eam, cum de avaritia, cum de intemperantia, cum de maximis vitiis loquetur, tamquam capitis accuset. <a href=''http://loripsum.net/'' target=''_blank''>Sed hoc sane concedamus.</a> </p>\r\n\r\n<p>An quae de prudentia, de cognitione rerum, de coniunctione generis humani, quaeque ab eisdem de temperantia, de modestia, de magnitudine animi, de omni honestate dicuntur? Pomponius Luciusque Cicero, frater noster cognatione patruelis, amore germanus, constituimus inter nos ut ambulationem postmeridianam conficeremus in Academia, maxime quod is locus ab omni turba id temporis vacuus esset. <b>Est enim effectrix multarum et magnarum voluptatum.</b> <i>Restinguet citius, si ardentem acceperit.</i> Satisne igitur videor vim verborum tenere, an sum etiam nunc vel Graece loqui vel Latine docendus? <code>Sed nimis multa.</code> <code>Beatum, inquit.</code> <i>Graece donan, Latine voluptatem vocant.</i> </p>\r\n\r\n<pre>\r\nUt enim nos ex annalium monimentis testes excitamus eos,\r\nquorum omnis vita consumpta est in laboribus gloriosis, qui\r\nvoluptatis nomen audire non possent, sic in vestris\r\ndisputationibus historia muta est.\r\n\r\nNam e quibus locis quasi thesauris argumenta depromerentur,\r\nvestri ne suspicati quidem sunt, superiores autem artificio\r\net via tradiderunt.\r\n</pre>\r\n\r\n\r\n<dl>\r\n	<dt><dfn>Si quae forte-possumus.</dfn></dt>\r\n	<dd>Tenesne igitur, inquam, Hieronymus Rhodius quid dicat esse summum bonum, quo putet omnia referri oportere?</dd>\r\n	<dt><dfn>Quid Zeno?</dfn></dt>\r\n	<dd>Inde sermone vario <i>[redacted]</i> illa a Dipylo stadia confecimus.</dd>\r\n	<dt><dfn>Quis hoc dicit?</dfn></dt>\r\n	<dd>Quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus;</dd>\r\n</dl>\r\n\r\n\r\n<p><a href=''http://loripsum.net/'' target=''_blank''>Scaevolam M.</a> Nec enim absolvi beata vita sapientis neque ad exitum perduci poterit, si prima quaeque bene ab eo consulta atque facta ipsius oblivione obruentur. <a href=''http://loripsum.net/'' target=''_blank''>Prioris generis est docilitas, memoria;</a> <i>Ut id aliis narrare gestiant?</i> Atque ut reliqui fures earum rerum, quas ceperunt, signa commutant, sic illi, ut sententiis nostris pro suis uterentur, nomina tamquam rerum notas mutaverunt. Nos commodius agimus. <b>Sed ille, ut dixi, vitiose.</b> Quid, si etiam bestiae multa faciunt duce sua quaeque natura partim indulgenter vel cum labore, ut in gignendo, in educando, perfacile appareat aliud quiddam iis propositum, non voluptatem? <code>Qui convenit?</code> Ut ei, qui iucunde vixerit annos decem, si aeque vita iucunda menstrua addatur, quia momentum aliquod habeat ad iucundum accessio, bonum sit; Sed emolumenta communia esse dicuntur, recte autem facta et peccata non habentur communia. </p>\r\n\r\n<blockquote cite=''http://loripsum.net''>\r\n	Sed tu, ut dignum est tua erga me et philosophiam voluntate ab adolescentulo suscepta, fac ut Metrodori tueare liberos.\r\n</blockquote>\r\n\r\n\r\n<p>Cum autem progrediens confirmatur animus, agnoscit ille quidem naturae vim, sed ita, ut progredi possit longius, per se sit tantum inchoata. <i>Tria genera bonorum;</i> Ex quo intellegitur nec intemperantiam propter se esse fugiendam temperantiamque expetendam, non quia voluptates fugiat, sed quia maiores consequatur. Iure igitur gravissimi philosophi initium summi boni a natura petiverunt et illum appetitum rerum ad naturam accommodatarum ingeneratum putaverunt omnibus, quia continentur ea commendatione naturae, qua se ipsi diligunt. In eo enim positum est id, quod dicimus esse expetendum. Quibus natura iure responderit non esse verum aliunde finem beate vivendi, a se principia rei gerendae peti; Praesertim cum in re publica princeps esse velles ad eamque tuendam cum summa tua dignitate maxime a nobis ornari atque instrui posses. Societatem coniunctionis humanae munifice et aeque tuens iustitia dicitur, cui sunt adiunctae pietas, bonitas, liberalitas, benignitas, comitas, quaeque sunt generis eiusdem. Nam si dicent ab illis has res esse tractatas, ne ipsos quidem Graecos est cur tam multos legant, quam legendi sunt. Perfecto enim et concluso neque virtutibus neque amicitiis usquam locum esse, si ad voluptatem omnia referantur, nihil praeterea est magnopere dicendum. Addo etiam illud, multa iam mihi dare signa puerum et pudoris et ingenii, sed aetatem vides. Quid tanto concursu honestissimorum studiorum, tanto virtutum comitatu, si ea nullam ad aliam rem nisi ad voluptatem conquiruntur? </p>\r\n\r\n<p><a href=''http://loripsum.net/'' target=''_blank''>At hoc in eo M.</a> Nam his libris eum malo quam reliquo ornatu villae delectari. Se dicere inter honestum et turpe nimium quantum, nescio quid inmensum, inter ceteras res nihil omnino interesse. <b>Quare attende, quaeso.</b> Cumque duae sint artes, quibus perfecte ratio et oratio compleatur, una inveniendi, altera disserendi, hanc posteriorem et Stoici et Peripatetici, priorem autem illi egregie tradiderunt, hi omnino ne attigerunt quidem. <a href=''http://loripsum.net/'' target=''_blank''>Ita prorsus, inquam;</a> Quem enim ardorem studii censetis fuisse in Archimede, qui dum in pulvere quaedam describit attentius, ne patriam quidem captam esse senserit? Lege laudationes, Torquate, non eorum, qui sunt ab Homero laudati, non Cyri, non Agesilai, non Aristidi aut Themistocli, non Philippi aut Alexandri, lege nostrorum hominum, lege vestrae familiae; </p>\r\n\r\n<ul>\r\n	<li>Tantum dico, magis fuisse vestrum agere Epicuri diem natalem, quam illius testamento cavere ut ageretur.</li>\r\n	<li>Est igitur officium eius generis, quod nec in bonis ponatur nec in contrariis.</li>\r\n	<li>Idem iste, inquam, de voluptate quid sentit?</li>\r\n	<li>Nunc ita separantur, ut disiuncta sint, quo nihil potest esse perversius.</li>\r\n	<li>Nummus in Croesi divitiis obscuratur, pars est tamen divitiarum.</li>\r\n	<li>Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem.</li>\r\n</ul>\r\n\r\n', '', 'filtered_html'),
('node', 'forum', 0, 7, 7, 'und', 0, 'This was shared to me from two of his friends who asked the same question unbeknownst to the other.  Thanks David and Tiffany.  \r\n\r\nApparently it can be done. There is some form of spray on solar, if the house printer could prepare a conductive surface, I don''t know why a final outside weather resistant coating for the sun facing areas of the 3d printed structures would be a good idea.. Greg', '', 'filtered_html');
