INSERT INTO `dr_search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' huttite project vision 3d printing homes and structures 10 year limit on trade secrets kickstarter for development of open source technology focused core mecahanical equipment project tracker system via app and huttiteorg website  ', 0),
(2, 'node', ' huttite printed structure knowledgebase our aim is to make use of kickstarter to support our initial efforts to warehouse 3d models provide tools for project management and peer review of 3d printing best practices and shared private logs of technology use from within the huttiteorg website and ios android win phone tablet app ecosystem  ', 0),
(3, 'node', ' basics of 3d printing for homes and structures we are directing our work in four areas toward providing a public test structures at appropriate locations 1 nozzle design and testing 2 batch recipe design and consistancy 3 robotic component design and hardware controller programming 3 continuous batch flow management 4 environmental legal and social parameter research 3d homes construction grade 3d printers 3s home construction ', 0),
(4, 'node', ' planning projects with existing 3d models i was looking around google sketchup s 3d warehouse and the most exportable format is google earth kml the above structure would be a pretty nice design esp where more roof surface area was beneficial cooling biologically active surfaces greg  ', 0),
(5, 'node', ' printing of local biomaterials this machine is known as the wasp demonstrating 3d printing of locally derived materials to produce a reinforced contoured structure wasp 3d printed houses ', 0),
(6, 'node', ' this is an example well formatted html5 document duo reges constructio interrete lorem ipsum dolor sit amet consectetur adipiscing elit quis enim redargueret quod ea non occurrentia fingunt vincunt aristonem quo modo igitur evenit ut hominis natura sola esset quae hominem relinqueret quali oblivisceretur corporis quae summum bonum non in toto homine sed in parte hominis poneret quid enim dicis omne animal simul atque sit ortum applicatum esse ad se diligendum esseque in se conservando occupatum quae dici eadem de ceteris virtutibus possunt quarum omnium fundamenta vos in voluptate tamquam in aqua ponitis quid enim dicis omne animal simul atque sit ortum applicatum esse ad se diligendum esseque in se conservando occupatum quae enim mala illi non audent appellare aspera autem et incommoda et reicienda et aliena naturae esse concedunt ea nos mala dicimus sed exigua et paene minima compensabatur inquit cum summis doloribus laetitia eadem fortitudinis ratio reperietur laboro autem non sine causa  ex ea quae sint apta ea bonesta ea pulchra ea laudabilia illa autem superiora naturale nominantur quae coniuncta cum honestis vitam beatam perficiunt et absolvunt quid enim est tam repugnans quam eundem dicere quod honestum sit solum id bonum esse qui dicat appetitionem rerum ad vivendum accommodatarum natura profectam iam autem callipho aut diodorus quo modo poterunt tibi istud concedere qui ad honestatem aliud adiungant quod ex eodem genere non sit  itaque contra est ac dicitis  summum ením bonum exposuit vacuitatem doloris quid tibi torquate quid huic triario litterae quid historiae cognitioque rerum quid poetarum evolutio quid tanta tot versuum memoria voluptatis affert appellet haec desideria naturae cupiditatis nomen servet alio ut eam cum de avaritia cum de intemperantia cum de maximis vitiis loquetur tamquam capitis accuset sed hoc sane concedamus an quae de prudentia de cognitione rerum de coniunctione generis humani quaeque ab eisdem de temperantia de modestia de magnitudine animi de omni honestate dicuntur pomponius luciusque cicero frater noster cognatione patruelis amore germanus constituimus inter nos ut ambulationem postmeridianam conficeremus in academia maxime quod is locus ab omni turba id temporis vacuus esset est enim effectrix multarum et magnarum voluptatum restinguet citius si ardentem acceperit satisne igitur videor vim verborum tenere an sum etiam nunc vel graece loqui vel latine docendus sed nimis multa beatum inquit graece donan latine voluptatem vocant ut enim nos ex annalium monimentis testes excitamus eos quorum omnis vita consumpta est in laboribus gloriosis qui voluptatis nomen audire non possent sic in vestris disputationibus historia muta est nam e quibus locis quasi thesauris argumenta depromerentur vestri ne suspicati quidem sunt superiores autem artificio et via tradiderunt si quae fortepossumus tenesne igitur inquam hieronymus rhodius quid dicat esse summum bonum quo putet omnia referri oportere quid zeno inde sermone vario redacted illa a dipylo stadia confecimus quis hoc dicit quamquam ab iis philosophiam et omnes ingenuas disciplinas habemus  scaevolam m nec enim absolvi beata vita sapientis neque ad exitum perduci poterit si prima quaeque bene ab eo consulta atque facta ipsius oblivione obruentur prioris generis est docilitas memoria  ut id aliis narrare gestiant atque ut reliqui fures earum rerum quas ceperunt signa commutant sic illi ut sententiis nostris pro suis uterentur nomina tamquam rerum notas mutaverunt nos commodius agimus sed ille ut dixi vitiose quid si etiam bestiae multa faciunt duce sua quaeque natura partim indulgenter vel cum labore ut in gignendo in educando perfacile appareat aliud quiddam iis propositum non voluptatem qui convenit ut ei qui iucunde vixerit annos decem si aeque vita iucunda menstrua addatur quia momentum aliquod habeat ad iucundum accessio bonum sit sed emolumenta communia esse dicuntur recte autem facta et peccata non habentur communia sed tu ut dignum est tua erga me et philosophiam voluntate ab adolescentulo suscepta fac ut metrodori tueare liberos cum autem progrediens confirmatur animus agnoscit ille quidem naturae vim sed ita ut progredi possit longius per se sit tantum inchoata tria genera bonorum ex quo intellegitur nec intemperantiam propter se esse fugiendam temperantiamque expetendam non quia voluptates fugiat sed quia maiores consequatur iure igitur gravissimi philosophi initium summi boni a natura petiverunt et illum appetitum rerum ad naturam accommodatarum ingeneratum putaverunt omnibus quia continentur ea commendatione naturae qua se ipsi diligunt in eo enim positum est id quod dicimus esse expetendum quibus natura iure responderit non esse verum aliunde finem beate vivendi a se principia rei gerendae peti praesertim cum in re publica princeps esse velles ad eamque tuendam cum summa tua dignitate maxime a nobis ornari atque instrui posses societatem coniunctionis humanae munifice et aeque tuens iustitia dicitur cui sunt adiunctae pietas bonitas liberalitas benignitas comitas quaeque sunt generis eiusdem nam si dicent ab illis has res esse tractatas ne ipsos quidem graecos est cur tam multos legant quam legendi sunt perfecto enim et concluso neque virtutibus neque amicitiis usquam locum esse si ad voluptatem omnia referantur nihil praeterea est magnopere dicendum addo etiam illud multa iam mihi dare signa puerum et pudoris et ingenii sed aetatem vides quid tanto concursu honestissimorum studiorum tanto virtutum comitatu si ea nullam ad aliam rem nisi ad voluptatem conquiruntur  at hoc in eo m nam his libris eum malo quam reliquo ornatu villae delectari se dicere inter honestum et turpe nimium quantum nescio quid inmensum inter ceteras res nihil omnino interesse quare attende quaeso cumque duae sint artes quibus perfecte ratio et oratio compleatur una inveniendi altera disserendi hanc posteriorem et stoici et peripatetici priorem autem illi egregie tradiderunt hi omnino ne attigerunt quidem ita prorsus inquam  quem enim ardorem studii censetis fuisse in archimede qui dum in pulvere quaedam describit attentius ne patriam quidem captam esse senserit lege laudationes torquate non eorum qui sunt ab homero laudati non cyri non agesilai non aristidi aut themistocli non philippi aut alexandri lege nostrorum hominum lege vestrae familiae tantum dico magis fuisse vestrum agere epicuri diem natalem quam illius testamento cavere ut ageretur est igitur officium eius generis quod nec in bonis ponatur nec in contrariis idem iste inquam de voluptate quid sentit nunc ita separantur ut disiuncta sint quo nihil potest esse perversius nummus in croesi divitiis obscuratur pars est tamen divitiarum scientiam pollicentur quam non erat mirum sapientiae cupido patria esse cariorem loremipsumcom loremipsumcom  ', 0),
(7, 'node', ' can i print a house and have the outside layer be solar electric generating surface  questiions we ve recieved this was shared to me from two of his friends who asked the same question unbeknownst to the other thanks david and tiffany apparently it can be done there is some form of spray on solar if the house printer could prepare a conductive surface i don t know why a final outside weather resistant coating for the sun facing areas of the 3d printed structures would be a good idea greg  ', 0);
